VALUES ('5400119004510', 'Assiette de hachis avec legumes', 'Pommes de terre 27% (pommes de terre, émulsifiant curcuma), lait demi-écrémé, hachis 15% [viande (E471), de veau 47%, viande de porc 44%, liant pour hachis (farine de blé, sel, fibre végétale de bambou, herbes et épices, sel, colorant (E150a)], chou-fleur 14%, crème, poireau 7%, chicon 4%, beurre, épinards 2%, échalote, herbes amidon modifié de maïs, dextrose, jus de citron, ail, sel, et épices, épaississants (E412, E415) Contient gluten, lait. Fabriqué dans un atelier qui utilise aussi: crustacés, ceufs, poisson, arachides, soja, fruits à coque, céleri, moutarde sésame, lupin, mollusques et sulfites.', 'https://static.openfoodfacts.org/images/products/540/011/900/4510/front_fr.4.400.jpg', '7.6', '4.2', '8.1', '2', '', '3.2', '0.63', '0.248031496062992', '', '1');

