INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5400119504799', 'Tortelloni Ricotta & Épinard', 'pâtes 57% (farine de ble tendre, œufs 21 %, semoule de blé dur, eau). Farce 43% [ricotta 34% (lactosérum, sel, correcteur d\'acidité: acide citrique , épinards 15%, flocons de pommes de terre (émulsifiant\'. mono - et diglycérides diacides ras), mozzarella, huile de tournesol, poudre de fromage (poudre de fromage, lactosérum en poudre, émulsifiant\'. citrate monosodique), beurre, lactose, cha elgure Sfarine de blé levure, sel), farine de riz, fibre de ble, sel, épices]. Zutaten: Nudeln 57% (Weich - weizenmehl, Eier 21 Hanueizengfieg, Wasser). Füfun 4 % [Ricotta 34% (Molke, Salz, Sâurerequlator: Citronensâure), SPInat 15%, Kartoffelflocken (Emul - otor Mono - und Diol ceride von Speisefettsduren), Mozzarela, Sonnenblumenôl, Kâsepulver (Küsepuluer, Molkepulver, Emulgator: Mononatriumcitrat), Butter, ?aktose, Paniermehl eizenmehl, Hefe, Salz), Reismehl, Weizenfaser,Salz, Gewürze]./Bereiding: breng211ichtqezoutwateraan de doeerdepasta bij en laot 3-4 min. koken. iet de pasta af en werk af met een scheutje olijfolie en wat parmezaan. Préparation: portez ZI d\'eau légèrement salée à ébullition, versez-y les pâtes et laissez cuire pendant 3-4 min. Egouttez-les et agrementez d\'un filet d\'huile d\'olive et de parmesan. Zubereitung: 2 1 leicht gesalzenes Wasser zurn Kochen bringen, die Nudeln hineingeben und 3-4 Min. kochen lassen. Wasser abgiegen und mit etwas Olivenôl und Parmesan servieren.', 'https://static.openfoodfacts.org/images/products/540/011/950/4799/front_fr.4.400.jpg', '8.5', '4', '40', '3.8', '3', '10', '1.3', '0.511811023622047', '', '0');

