INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5400119513784', 'Pâté au confit d\'oignons', 'foie de porc 31%, graisse de porc, confit d\'oignon 12% (oignon, sucre, jus de citron), couenne de porc, crème de riz (lait, farine de riz), lait, viande de porc 3,3%, aeuf, acidifiants (acétate de sodium, lactate de sodium), sel nitrité pour saumure [sel, conservateur (nitrite de sodium)], sucre, oignon frit (oignon, huile de palme, farine de sarrasin, sel), épices, arôme naturel, amidon de pois, an - tioxydants (acide ascorbique, acide citrique), dextrose, hémoglobine. ZUTATEN: Schweineleber 31%, Schweinefett, Zwiebelconfit 12% (Zwiebeln, Zucker, Zitronensaft), Schweineschwarte, Reiscreme (Milch, Reismehl), Milch, Schweinefleisch 3,3%, Ei, Säuerungsmittel (Natriumacetat, Natriumlactat), Nitritpökelsalz [Salz, Konservierungsstoff (Natriumnitrit)], Zucker, gebratene Zwiebeln (Zwiebeln, Palmöl, Buchweizenmehl, Salz), Gewürze, natürliches Aroma, Erbsen - stärke, Antioxidationsmittel (Ascorbinsäure, Citronensäure), Dextrose, Hämoglobin. Bevat: eieren, melk. Gemaakt in een bedrijf waar ook soja, noten, selderij en mosterd worden verwerkt. Contient: oeufs, lait. Fabriqué dans un atelier qui utilise aussi: soja, fruits à coque céleri et moutarde. Enthält: Eier, Milch. Hergestellt in einem Betrieb, der auch Soja, Schalenfrüch - te, Sellerie und Senf verwendet', 'https://static.openfoodfacts.org/images/products/540/011/951/3784/front_en.3.400.jpg', '30', '11', '12', '8', '0.5', '12', '2.3', '0.905511811023622', '0', '0');

