VALUES ('5400141022735', 'Soupe au poulet', 'Kippensoep-Water, groenten (8 % wortelen, knolselder prei, 3 % selder, 3 % uien, 1 % erwten), 4% kippenvlees, bouillon tarwegriesmeel, zout, maltodextrine, eieren, smaakversterkers (E621 E631, E627), zetmeel, kippenvet, aroma\'s (bevat eieren en selderijl, prei, kruiden, selder, rodebietensap, gistextract, kippenvlees], gemodificeerd zetmeel, specerijen. Bevat gluten, eieren en selderij. Kan sporen van soja en melk bevatten. Soupe au poulet - Eau, légumes (8 % carottes, céleri-rave, poireaux, 3 % céleri, 3 % oignons, 1% pois), 4 % viande de poutet, bouillon [semoule de blé dur, sel, maltodextrine, ceufs, exhausteurs de goût (E621, E631, E627), amidon, graisse de poule, arômes (contient des ceufs et du céleri), poireaux, plantes aromatiques, céleri, jus de betterave rouge, extrait de levure, viande de pouletl, amidon modifié, épices. Contient du gluten, des ceufs et du céleri. Peut contenir des traces de soja et de lait. Comiddelde uoodinncwaardo.Nalaur nutritinnnalla moven', 'https://static.openfoodfacts.org/images/products/540/014/102/2735/front_fr.14.400.jpg', '0.5', '0', '3.9', '1.1', '', '1.9', '1', '0.393700787401575', '', '1');

